INSERT INTO `nacos_config`.`config_info`(`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (1, 'application-dev.yml', 'DEFAULT_GROUP', 'behappy:\n  aliyun:\n    access-key-id: \n    access-key-secret: \n  mongo:\n    host: 192.168.56.100:27017\n    username: root\n    password: root\n    db:\n      order: yygh_hosp\n      hosp: yygh_hosp\n  rabbitmq:\n    host: 192.168.56.100\n    port: 5672\n    virtual-host: /\n    username: root\n    password: root\n  xxl-admin:\n    addresses: http://192.168.56.100:8080/xxl-job-admin\n  mysql:\n    password: root\n    username: root\n    host: 192.168.56.100:3306\n    db:\n      cmn: yygh_cmn\n      user: yygh_user\n      hosp: yygh_hosp\n      manager: yygh_manager\n      order: yygh_order\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \"*\"\n  endpoint:\n    health:\n      show-details: ALWAYS\nspring:\n  mvc:\n    pathmatch:\n      matching-strategy: ANT_PATH_MATCHER', '08b949bcba243737fa2a6ba6dee22807', '2023-03-08 21:47:39', '2023-03-08 21:47:39', NULL, '192.168.56.1', 'ALL', '1c3bfebf-a571-44d6-9b75-70fd124cbcf7', '所有模块的共享配置', NULL, NULL, 'yaml', NULL);
INSERT INTO `nacos_config`.`config_info`(`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (2, 'redis-dev.yml', 'DEFAULT_GROUP', 'spring:\n  redis:\n    redisson:\n      config: |-\n        # 例: 单节点设置\n        singleServerConfig:\n          # （节点地址）redis://-非ssl,rediss://-ssl\n          address: redis://192.168.56.100:6379\n          database: 0\n          password: null\n          # 如果当前连接池里的连接数量超过了`最小空闲连接数`，而同时有连接空闲时间超过了该数值，那么这些连接将会自动被关闭，并从连接池里去掉。时间单位是毫秒。\n          idleConnectionTimeout: 10000\n          # 同节点建立连接时的等待超时。时间单位是毫秒。\n          connectTimeout: 10000\n          # 等待节点回复命令的时间。该时间从命令发送成功时开始计时。\n          timeout: 3000\n          # 如果尝试达到 retryAttempts（命令失败重试次数） 仍然不能将命令发送至某个指定的节点时，将抛出错误。如果尝试在此限制之内发送成功，则开始启用 timeout（命令等待超时） 计时。\n          retryAttempts: 3\n          # 在某个节点执行相同或不同命令时，连续 失败 failedAttempts（执行失败最大次数） 时，该节点将被从可用节点列表里清除，直到 reconnectionTimeout（重新连接时间间隔） 超时以后再次尝试。\n          retryInterval: 1500\n          # 在Redis节点里显示的客户端名称。\n          clientName: null\n          # 发布和订阅连接的最小空闲连接数 默认1\n          subscriptionConnectionMinimumIdleSize: 1\n          # 发布和订阅连接池大小 默认50\n          subscriptionConnectionPoolSize: 50\n          # 单个连接最大订阅数量 默认5\n          subscriptionsPerConnection: 5\n          # 最小空闲连接数 默认32，现在暂时不需要那么多的线程\n          connectionMinimumIdleSize: 4\n          # 连接池大小,在启用该功能以后，Redisson将会监测DNS的变化情况。\n          connectionPoolSize: 64\n          # 监测DNS的变化情况的时间间隔。\n          dnsMonitoringInterval: 5000\n        # 这个线程池数量被所有RTopic对象监听器，RRemoteService调用者和RExecutorService任务共同共享。\n        threads: 0\n        # 这个线程池数量是在一个Redisson实例内，被其创建的所有分布式数据类型和服务，以及底层客户端所一同共享的线程池里保存的线程数量。\n        nettyThreads: 0\n        # 序列化方式, 内部提供了`ruedigermoeller`的fst方式,配置如下即可\n        # (默认为jackson方式)如果想要适用jdk的编码方式,可以如下配置,jdk编码方式model必须实现序列化接口\n        codec: !<org.xiaowu.behappy.redis.serializer.FstCodec> {}\n        transportMode: NIO', '607d1165d62bbed969ad3c11e3ec1e35', '2023-03-08 21:47:39', '2023-03-08 21:47:39', NULL, '192.168.56.1', 'Redis', '1c3bfebf-a571-44d6-9b75-70fd124cbcf7', 'Redis共享配置', NULL, NULL, 'yaml', NULL);
INSERT INTO `nacos_config`.`config_info`(`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (3, 'behappy-cmn-dev.yml', 'DEFAULT_GROUP', 'spring:\n  datasource:\n    password: ${behappy.mysql.password:root}\n    username: ${behappy.mysql.username:root}\n    url: jdbc:mysql://${behappy.mysql.host:192.168.56.100:3306}/${behappy.mysql.db.cmn:yygh_cmn}?allowMultiQueries=true&useSSL=false&useUnicode=true&characterEncoding=UTF-8&autoReconnect=true&zeroDateTimeBehavior=convertToNull&useJDBCCompliantTimezoneShift=true&useLegacyDatetimeCode=false&serverTimezone=GMT%2B8&nullCatalogMeansCurrent=true', 'a2380301382b20b42cd63937d0c4ec10', '2023-03-08 21:47:39', '2023-03-08 21:47:39', NULL, '192.168.56.1', 'behappy-cmn', '1c3bfebf-a571-44d6-9b75-70fd124cbcf7', '', NULL, NULL, 'yaml', NULL);
INSERT INTO `nacos_config`.`config_info`(`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (4, 'behappy-manager-dev.yml', 'DEFAULT_GROUP', 'spring:\n  thymeleaf:\n    mode: LEGACYHTML5\n    #编码 可不用配置\n    encoding: UTF-8\n    #开发配置为false,避免修改模板还要重启服务器\n    cache: false\n    #配置模板路径，默认是templates，可以不用配置\n    prefix: classpath:/templates/\n  datasource:\n    type: com.alibaba.druid.pool.DruidDataSource\n    password: ${behappy.mysql.password:root}\n    username: ${behappy.mysql.username:root}\n    url: jdbc:mysql://${behappy.mysql.host:192.168.56.100:3306}/${behappy.mysql.db.manage:yygh_manage}?allowMultiQueries=true&useSSL=false&useUnicode=true&characterEncoding=UTF-8&autoReconnect=true&zeroDateTimeBehavior=convertToNull&useJDBCCompliantTimezoneShift=true&useLegacyDatetimeCode=false&serverTimezone=GMT%2B8&nullCatalogMeansCurrent=true\n  jackson:\n    date-format: yyyy-MM-dd HH:mm:ss\n    time-zone: GMT+8', '5654ad6bc661895e3ba55b99ade1c6a7', '2023-03-08 21:47:39', '2023-03-08 21:47:39', NULL, '192.168.56.1', 'behappy-manager', '1c3bfebf-a571-44d6-9b75-70fd124cbcf7', '', NULL, NULL, 'yaml', NULL);
INSERT INTO `nacos_config`.`config_info`(`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (5, 'behappy-hosp-dev.yml', 'DEFAULT_GROUP', 'spring:\n  rabbitmq:\n    host: ${behappy.rabbitmq.host:192.168.56.100}\n    port: ${behappy.rabbitmq.port:5672}\n    # 指定虚拟主机\n    virtual-host: ${behappy.rabbitmq.virtual-host:/}\n    username: ${behappy.rabbitmq.username:root}\n    password: ${behappy.rabbitmq.password:root}\n    # 开启发送端确认\n    publisher-confirm-type: correlated\n    #　开启发送端消息抵达队列确认\n    publisher-returns: true\n    # 只要抵达队列，以异步优先回调我们这个 return/confirm\n    template:\n      mandatory: true\n    # 手动ack消息 消息不容易丢失\n    listener:\n      simple:\n        acknowledge-mode: manual\n  datasource:\n    password: ${behappy.mysql.password:root}\n    username: ${behappy.mysql.username:root}\n    url: jdbc:mysql://${behappy.mysql.host:192.168.56.100:3306}/${behappy.mysql.db.hosp:yygh_hosp}?allowMultiQueries=true&useSSL=false&useUnicode=true&characterEncoding=UTF-8&autoReconnect=true&zeroDateTimeBehavior=convertToNull&useJDBCCompliantTimezoneShift=true&useLegacyDatetimeCode=false&serverTimezone=GMT%2B8&nullCatalogMeansCurrent=true\n  data:\n    #uri: mongodb://用户名:密码@服务器IP:端口/数据库名\n    # 上方为明确指定某个数据的用户进行连接\n    # 也可以使用admin 数据库中的用户进行连接  统一到admin 数据库进行认证\n    # admin 用户认证 url 写法： mongodb://账户:密码@ip:端口/数据库名?authSource=admin&authMechanism=SCRAM-SHA-1\n    mongodb:\n      uri: mongodb://${behappy.mongo.username:root}:${behappy.mongo.password:root}@${behappy.mongo.host:192.168.56.100:27017}/${behappy.mongo.db.hosp:yygh_hosp}?authSource=admin&authMechanism=SCRAM-SHA-1', 'ad2ebb92c37e1b659ed6b5af20edf690', '2023-03-08 21:47:39', '2023-03-08 21:47:39', NULL, '192.168.56.1', 'behappy-hosp', '1c3bfebf-a571-44d6-9b75-70fd124cbcf7', '', NULL, NULL, 'yaml', NULL);
INSERT INTO `nacos_config`.`config_info`(`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (6, 'behappy-gateway-dev.yml', 'DEFAULT_GROUP', 'spring:\n  cloud:\n    sentinel:\n      # 取消Sentinel控制台懒加载\n      eager: true\n      transport:\n        dashboard: 192.168.56.100:8858\n      scg:\n        fallback:\n          mode: response\n          response-status: 426\n          response-body: \'{\"code\": 426,\"message\": \"限流\"}\'\n          content-type: application/json\n      datasource:\n        gw-ds1:\n          nacos:\n            server-addr: ${spring.cloud.nacos.server-addr:192.168.56.100:8848}\n            username: ${spring.cloud.nacos.username:nacos}\n            password: ${spring.cloud.nacos.password:nacos}\n            rule-type: gw_flow\n            data-type: json\n            data-id: ${spring.application.name}-gw-rules\n            namespace: 4e8525e0-335b-46c1-b61e-1a46c5f0a147\n        gw-api-ds1:\n          nacos:\n            server-addr: ${spring.cloud.nacos.server-addr:192.168.56.100:8848}\n            username: ${spring.cloud.nacos.username:nacos}\n            password: ${spring.cloud.nacos.password:nacos}\n            rule-type: gw_api_group\n            data-type: json\n            data-id: ${spring.application.name}-gw-api-rules\n            namespace: 4e8525e0-335b-46c1-b61e-1a46c5f0a147\n        degrade-ds1:\n          nacos:\n            server-addr: ${spring.cloud.nacos.server-addr:192.168.56.100:8848}\n            username: ${spring.cloud.nacos.username:nacos}\n            password: ${spring.cloud.nacos.password:nacos}\n            rule-type: degrade\n            data-type: json\n            data-id: ${spring.application.name}-degrade-rules\n            namespace: 4e8525e0-335b-46c1-b61e-1a46c5f0a147\n        system-ds1:\n          nacos:\n            server-addr: ${spring.cloud.nacos.server-addr:192.168.56.100:8848}\n            username: ${spring.cloud.nacos.username:nacos}\n            password: ${spring.cloud.nacos.password:nacos}\n            rule-type: system\n            data-type: json\n            data-id: ${spring.application.name}-system-rules\n            namespace: 4e8525e0-335b-46c1-b61e-1a46c5f0a147\n    gateway:\n      discovery:\n        locator:\n          enabled: true\n          lower-case-service-id: true\n      routes:\n        - id: behappy-hosp\n          uri: lb://behappy-hosp\n          predicates:\n            - Path=/*/hosp/**\n        #          filters:\n        #            - RewritePath=/api/(?<segment>.*),/$\\{segment}\n        - id: behappy-cmn\n          uri: lb://behappy-cmn\n          predicates:\n            - Path=/*/cmn/**\n        - id: behappy-user\n          uri: lb://behappy-user\n          predicates:\n            - Path=/*/user/**,/*/ucenter/**\n        - id: behappy-msm\n          uri: lb://behappy-msm\n          predicates:\n            - Path=/*/msm/**\n        - id: behappy-oss\n          uri: lb://behappy-oss\n          predicates:\n            - Path=/*/oss/**\n        - id: behappy-order\n          uri: lb://behappy-order\n          predicates:\n            - Path=/*/order/**\n        - id: behappy-manager\n          uri: lb://behappy-manager\n          predicates:\n            - Path=/*\n', '8a03c12be199f838b711eefdc6d508a2', '2023-03-08 21:47:39', '2023-03-08 21:47:39', NULL, '192.168.56.1', 'behappy-gateway', '1c3bfebf-a571-44d6-9b75-70fd124cbcf7', '', NULL, NULL, 'yaml', NULL);
INSERT INTO `nacos_config`.`config_info`(`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (7, 'behappy-executor-task-dev.yml', 'DEFAULT_GROUP', 'spring:\n  rabbitmq:\n    host: ${behappy.rabbitmq.host:192.168.56.100}\n    port: ${behappy.rabbitmq.port:5672}\n    # 指定虚拟主机\n    virtual-host: ${behappy.rabbitmq.virtual-host:/}\n    username: ${behappy.rabbitmq.username:root}\n    password: ${behappy.rabbitmq.password:root}\n    # 开启发送端确认\n    publisher-confirm-type: correlated\n    #　开启发送端消息抵达队列确认\n    publisher-returns: true\n    # 只要抵达队列，以异步优先回调我们这个 return/confirm\n    template:\n      mandatory: true\n    # 手动ack消息 消息不容易丢失\n    listener:\n      simple:\n        acknowledge-mode: manual\nlogging:\n  config: classpath:logback-spring.xml\nxxl:\n  job:\n    #调度中心通讯TOKEN [选填]：非空时启用\n    accessToken: default_token\n    admin:\n      addresses: ${behappy.xxl-admin.addresses:http://192.168.56.100:8080/xxl-job-admin}\n    executor:\n      #执行器IP，默认为空表示自动获取IP\n      ip: \n      address: \n      #xxljob配置的端口号，默认为9999\n      port: 9999\n      #xxljob配置的执行器名称，\n      appname: behappy-executor-task\n      #执行器运行日志文件存储磁盘路径\n      logpath: /data/applogs/xxl-job/jobhandler\n      #调度中心日志表数据保存天数，过期日志自动清理；限制大于等于7时生效，否则, 如-1，关闭自动清理功能\n      logretentiondays: 7\n', 'f4f611abdf6efb64ce1367b7d8808673', '2023-03-08 21:47:39', '2023-03-08 21:47:39', NULL, '192.168.56.1', 'behappy-executor-task', '1c3bfebf-a571-44d6-9b75-70fd124cbcf7', '', NULL, NULL, 'yaml', NULL);
