INSERT INTO `nacos_config`.`config_info`(`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (13, 'sentinel-dev.yml', 'DEFAULT_GROUP', 'feign:\n  sentinel:\n    enabled: true\nspring: \n  cloud:\n    openfeign:\n      okhttp:\n        enabled: false\n      httpclient:\n        enabled: true\n        max-connections: 200 # 最大的连接数\n        max-connections-per-route: 50 # 每个路径的最大连接数\n      client:\n        config:\n          default: # default全局的配置\n            loggerLevel: basic # 日志级别，BASIC就是基本的请求和响应信息\n            connectTimeout: 10000\n            readTimeout: 10000\n      compression:\n        request:\n          enabled: true\n        response:\n          enabled: true\n    sentinel:\n      # 取消Sentinel控制台懒加载\n      eager: true\n      transport:\n        dashboard: 192.168.56.100:8858\n      datasource:\n        flow-ds1:\n          nacos:\n            server-addr: ${spring.cloud.nacos.server-addr:192.168.56.100:8848}\n            username: ${spring.cloud.nacos.username:nacos}\n            password: ${spring.cloud.nacos.password:nacos}\n            rule-type: flow\n            data-type: json\n            data-id: ${spring.application.name}-flow-rules\n            namespace: 4e8525e0-335b-46c1-b61e-1a46c5f0a147\n        degrade-ds1:\n          nacos:\n            server-addr: ${spring.cloud.nacos.server-addr:192.168.56.100:8848}\n            username: ${spring.cloud.nacos.username:nacos}\n            password: ${spring.cloud.nacos.password:nacos}\n            rule-type: degrade\n            data-type: json\n            data-id: ${spring.application.name}-degrade-rules\n            namespace: 4e8525e0-335b-46c1-b61e-1a46c5f0a147\n        system-ds1:\n          nacos:\n            server-addr: ${spring.cloud.nacos.server-addr:192.168.56.100:8848}\n            username: ${spring.cloud.nacos.username:nacos}\n            password: ${spring.cloud.nacos.password:nacos}\n            rule-type: system\n            data-type: json\n            data-id: ${spring.application.name}-system-rules\n            namespace: 4e8525e0-335b-46c1-b61e-1a46c5f0a147\n        param-flow-ds1:\n          nacos:\n            server-addr: ${spring.cloud.nacos.server-addr:192.168.56.100:8848}\n            username: ${spring.cloud.nacos.username:nacos}\n            password: ${spring.cloud.nacos.password:nacos}\n            rule-type: param_flow\n            data-type: json\n            data-id: ${spring.application.name}-param-flow-rules\n            namespace: 4e8525e0-335b-46c1-b61e-1a46c5f0a147\n        authority-ds1:\n          nacos:\n            server-addr: ${spring.cloud.nacos.server-addr:192.168.56.100:8848}\n            username: ${spring.cloud.nacos.username:nacos}\n            password: ${spring.cloud.nacos.password:nacos}\n            rule-type: authority\n            data-type: json\n            data-id: ${spring.application.name}-authority-rules\n            namespace: 4e8525e0-335b-46c1-b61e-1a46c5f0a147', '17b8c1da52e3859216453aa17d81624b', '2023-03-08 21:47:39', '2023-03-08 21:47:39', NULL, '192.168.56.1', 'SENTINEL', '1c3bfebf-a571-44d6-9b75-70fd124cbcf7', 'sentinel共享配置', NULL, NULL, 'yaml', NULL);
INSERT INTO `nacos_config`.`config_info`(`id`, `data_id`, `group_id`, `content`, `md5`, `gmt_create`, `gmt_modified`, `src_user`, `src_ip`, `app_name`, `tenant_id`, `c_desc`, `c_use`, `effect`, `type`, `c_schema`) VALUES (14, 'datasource-dev.yml', 'DEFAULT_GROUP', 'spring:\n  datasource:\n    # druid-dev.yml\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    druid:\n      aop-patterns: org.xiaowu.behappy.*  #监控SpringBean\n      filters: stat,wall     # 底层开启功能，stat（sql监控），wall（防火墙）\n      stat-view-servlet:   # 配置监控页功能\n        enabled: true\n        login-username: admin\n        login-password: admin\n        resetEnable: false\n      web-stat-filter:  # 监控web\n        enabled: true\n        urlPattern: /*\n        exclusions: \'*.js,*.gif,*.jpg,*.png,*.css,*.ico,/druid/*\'\n      filter:\n        stat:    # 对上面filters里面的stat的详细配置\n          slow-sql-millis: 1000\n          logSlowSql: true\n          enabled: true\n        wall:\n          enabled: true\n          config:\n            drop-table-allow: false\n# mybaits-dev.yml配置\nmybatis-plus:\n  mapper-locations: classpath:/mapper/*.xml\n  global-config:\n    banner: false\n    db-config:\n      table-underline: true\n      logic-delete-value: 1\n      logic-not-delete-value: 0\n  configuration:\n    map-underscore-to-camel-case: true\n    #开启sql日志\n    log-impl: org.apache.ibatis.logging.stdout.StdOutImpl', '27c6ff65ddc4aef555f80a5c26c37d9f', '2023-03-08 21:47:39', '2023-03-08 21:47:39', NULL, '192.168.56.1', 'DATASOURCE', '1c3bfebf-a571-44d6-9b75-70fd124cbcf7', '', NULL, NULL, 'yaml', NULL);
